query:
mutation policyTlsInspectRemoveSection ( $accountId:ID! $tlsInspectPolicyMutationInput:TlsInspectPolicyMutationInput $policyRemoveSectionInput:PolicyRemoveSectionInput!) {
	policy ( accountId:$accountId ) {
		tlsInspect ( input:$tlsInspectPolicyMutationInput  )  {
			removeSection ( input:$policyRemoveSectionInput   ) {
				section {
					audit {
						updatedTime
						updatedBy
					}
					section {
						id
						name
					}
					properties
				}
				status
				errors {
					errorMessage
					errorCode
				}
			}
		}
	}	
}
